import React from "react";
import "./imageDiv.css";

const imageDiv = props => (
  <img
    className={
      "col-md-3 col-sm-4 col-xs-12 pb-4 imageBlock rounded-circle " +
      (props.gameStatus == "2"
        ? " gameLost"
        : props.gameStatus == "1"
        ? " gameWon"
        : "")
    }
    src={process.env.PUBLIC_URL + "/images/" + props.images}
    alt={props.alt}
    height={props.imageDivHeight}
    width={props.imageDivWidth}
    onClick={props.clickHandler}
  />
);

export default imageDiv;
